import React from "react";
import {useSelector, useDispatch} from "react-redux";
import "./App.less";

function App() {
  return (
    <div className="App">
      <h1>Test</h1>
      <p><span style={{margin: "10px 20px", cursor: "pointer"}}>+</span><span style={{cursor: "pointer"}}>-</span></p>
      <p></p>
    </div>
  );
}

export default App;
